import React, { useEffect, useState } from "react";
import Navbar from "../components/navbar";
import "./prevent.css";
const Prevent = () => {
  return (
    <div>
      <Navbar />
      <h1>รู้ไว้ไม่โดนโกง</h1>
      <div className="row">
        <div className="column">
        <Col xs={6} md={4}>
          <Image src="logo11.ppng/171x180" roundedCircle />
        </Col>
        </div>
      </div>
    </div>
  );
};

export default Prevent;
